markerLib['D14844'] = {"Dnum":"D14844","state":"CO","county":"La Plata","age":"Cretaceous","formation":"Float from thin limestones in the Juana Lopez Member of the Mancos Shale","member":"","stage":"Turonian","substage":"Upper","ageDate":"89.3","resume":"Scaphites whitfieldi, Portion of a slightly flattened, ~ 3 inch diameter, very hard “burrow” that is developed on, but not in, limestone #2 (D14841 level). These “burrows” are several feet long, orientated parallel to bedding and bifurcate. They break into conical segments that litter the ground, often covering the outcrop. Similar “burrows” occur in the shale between the first two Scip Zone limestones. Limestone #2 is highly burrowed with burrow fillings of many different sizes up to 1/2 inch in diameter that are vertical or oblique to bedding and horizontal, branched burrows up to 1 inch in diameter that are parallel to bedding; both horizontal and oblique burrows are filled with matrx material. Limestone #2 is a lighter gray color and composed of softer, more clay rich carbonate than the dense, micritic, dark gray limestone of these large “burrow” fillings. All burrows from limestone #2 are composed of the same lithic material as the limestone bed. The “burrows” formed in the calcareous shale between the first two limestones are likewise made of hard, dense micrite. If these cyclindrical, y-shaped micrite tubes repesent burrows, they would have to have been made by a fairly large animal, perhaps a crab or other crustacean. No crustacean fossils have been found in the basal Bridge Creek Beds at Carthage even though we have dedicated several days to looking expressly for crustacean fossils, or fossils of other animals that could have made such large burrows in these beds. Based on (1) the absence of crustacean fossils or fossils of other burrowing animals large enough to make a 4 inch-diameter burrow and (2) the presence of non-matrix fillings of the micrite “burrows”, we conclude that these large, y-shaped, cylindrical tubes are concretions of inorganic origin.","Ifossil":"Scaphites whitfieldi,","collector":"S. C. Hook","date":"July 12, 2009","lat":"37.29739","lon":"-107.83919","reference":""};markerLib['D14844'].marker = makeMarker(markerLib['D14844'].Dnum,markerLib['D14844'].lat,markerLib['D14844'].lon);swhitfieldiGroup.addLayer(markerLib['D14844'].marker);
